import React, { useEffect, useState } from "react";
import "./Circle.css";

export default function Circle() {
  const [user, setUser] = useState([]);
  useEffect(() => {
    fetch("https://online.ntnu.no/api/v1/users/?rfid=0260434848")
      .then((res) => res.json())
      .then((res) => setUser(res.results[0]));
  }, []);

  const r = 700 / (Math.PI * 2)
  const width = 250
  const d = r * 2
  const y = (width - 222.81692) / 2
  const pathData = [
      'M', width/2, y,
      'A', r, r, 0, 0, 1, 0, d,
      'A', r, r, 0, 0, 1, 0, -d,
  ]
  console.log(d, r, y)

  return (
    <div className="container">
      <svg height={width} width={width} className="circle">
        <path
          d="
        m 125 13.591539
        a 111.40846 111.40846 0 0 1 0 222.81692
        a 111.40846 111.40846 0 0 1 0 -222.81692"
        fill="transparent"
        stroke="#0D5474"
        strokeWidth="3"
        strokeDasharray="700, 700"
        ></path>
        <text x="50%" y="50%" fill="white" textAnchor="middle">
          {user.first_name} {user.last_name}
        </text>
      </svg>
    </div>
  );
}
